        { x: 9, y: 0 }
      ];

    const [state,setState]=useState([])

    const handleMouseOver=()=>{
        console.log('qqqq')
    }
    const qq=(value,{index})=>{
        console.log(value)
        console.log('aa',index)
        setState(data[index])
    }




  return (
    <>
    <XYPlot height={300} width={300} onMouseLeave={handleMouseOver}>
          <VerticalGridLines />
          <HorizontalGridLines />
          <XAxis />
          <YAxis />
          <LineSeries data={data} onNearestX={qq} />
